import React from 'react';

const Course = ({ course }) => {
  return (
    <div>
      <h2>{course.name}</h2>
      {course.parts.map(part => (
        <div key={part.id}>
          <p>{part.name} {part.exercises} </p>
        </div>
      ))}
    </div>
  );
};

export default Course;
